import React from "react";
import { Link } from "react-router-dom";

import landingImg from "/home/ramiro/Desktop/PI-Pokemon-main/client/src/assets/landing.jpg";

export default function Landing() {
  return (
    <div>
      <h1>ESTOY EN LANDING</h1>
      <h1>Pokemon</h1>
      <Link to="/home">
        <button>GO</button>
      </Link>
      <img src={landingImg} alt="" />
    </div>
  );
}
